<html>
<style>
    @page {
        size: a4 landscape;
        padding: 0;
        margin: 0;

        @frame background_image { /* Another static Frame */
            -pdf-frame-content: background_image;
            left: 0pt; top: 0pt;
        }
        @frame remove_title_cart { /* Another static Frame */
            -pdf-frame-content: remove_title_cart;
            left: 0pt; top: 40pt; width: 470pt;
        }
        @frame name { /* Another static Frame */
            -pdf-frame-content: name;
            left: 0pt; top: 40pt;
        }
        @frame qrcode { /* Another static Frame */
            -pdf-frame-content: qrcode;
            left: 10pt; top: 200pt; width: 300pt;
        }
        @frame jnj_title { /* Another static Frame */
            -pdf-frame-content: jnj_title;
            right: 0pt; top: 170pt; width: 305pt;
        }
        @frame person_contacter { /* Another static Frame */
            -pdf-frame-content: person_contacter;
            left: 10pt; top: 450pt; width: 500pt;
        }
    }
    .fond {
        width: 29.7cm;
        height: auto;
    }
    #remove_title_cart {
        background-color: #fff;
        height: 100px;
    }
    #name {
        padding: 20px;
    }
    #qrcode img {
        width: 350px;
    }
    #jnj_title {
        text-align: center;
        color: #fff;
        background-color: #061e40;
    }
    #person_contacter {
        font-size: 2rem;
    }
</style>

<body>
    <!-- Content for Static Frame 'remove_title_cart' -->
    <div id="remove_title_cart">
        <br><br><br><br><br><br><br><br>
        <br><br><br><br>
    </div>

    <!-- Content for Static Frame 'name' -->
    <div id="name">
        <span style="font-size: 6rem; color: #F00;">{{part.first_name}} {{part.last_name}}</span>
        <br><br>
        <span style="font-size: 4rem; margin: 20px;">{{part.diocese}} </span>
        <br><br>
        <span style="font-size: 2rem; padding: 20px;">{{part.paroisse}}</span> 
        <br><br>
        <span style="font-size: 2rem; padding: 20px;">{{part.sexe}}</span> 
    </div>

    <!-- Content for Static Frame 'qrcode' -->
    <div id="qrcode">
        <img src="data:image/png;base64,{{ qrcode | safe }}">
    </div>

    <!-- Content for Static Frame 'jnj_title' -->
    <div id="jnj_title">
        <strong style="font-size: 7rem;">
            JNJ <br>
            <span style="color: #F00;">EBOLOWA</span> <br>
            2022
        </strong>
        <br><br><br><br><br>
        <span style="font-size: 4rem;"> {{part.phone_number}} </span>
        <br><br><br><br><br><br>
    </div>

    <!-- Content for Static Frame 'person_contacter' -->
    <div id="person_contacter">
        <strong>A contacter</strong> : {{part.person_contacter_name}} - {{part.person_contacter_phone}}
    </div>
